import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './COMPONENTS/HOME';
import About from './COMPONENTS/ABOUT';
function App() {
  return (
    <div className="App">
      <nav>
        <h1>Loan Calculator</h1>
        <div>

        </div>
      </nav>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
